import React from "react";
import explicit from "./explicit.png";
import "./tracks.css";
import { OverlayTrigger } from "react-bootstrap";
import { Button } from "react-bootstrap";

export default function TrackSearchResult({ track, chooseTrack }) {
  function handlePlay() {
    chooseTrack(track);
  }
  //console.log(artist);
  return (
    <div>
      <div
        className="d-flex m-2 align-items-center hover-zoom "
        id="tracks"
        style={{ cursor: "pointer" }}
        onClick={handlePlay}
      >
        {" "}
        <div className="m-2">{track.rank}</div>
        <img
          src={track.art}
          className="m-2"
          style={{ height: "64px", width: "64px" }}
        />
        <div id="trackDetails" className="m-2">
          <div>
            {track.name}{" "}
            {track.explicit ? (
              <img
                src={explicit}
                style={{ height: "16px", width: "16px" }}
              ></img>
            ) : (
              " "
            )}
          </div>
          <div className="text-muted">{track.albumName}</div>
          <div className="text-muted">{"Released: " + track.release}</div>
          {/* <div className="text-muted">{track.artist}</div> */}
        </div>
      </div>
      <div>
        <>
          {["top", "right", "bottom", "left"].map((placement) => (
            <OverlayTrigger
              trigger="click"
              key={placement}
              placement={placement}
              overlay={
                <Popover id={`popover-positioned-${placement}`}>
                  <Popover.Header as="h3">{`Popover ${placement}`}</Popover.Header>
                  <Popover.Body>
                    <strong>Holy guacamole!</strong> Check this info.
                  </Popover.Body>
                </Popover>
              }
            >
              <Button variant="secondary">Popover on {placement}</Button>
            </OverlayTrigger>
          ))}
        </>
      </div>
    </div>
  );
}
